import React from 'react';
import { Line, Bar } from "react-chartjs-2";


import {
    Button,
    ButtonGroup,
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    UncontrolledDropdown,
    Label,
    FormGroup,
    Input,
    Table,
    Row,
    Col,
    UncontrolledTooltip,
  } from "reactstrap";

  import {
    LineChart2,
    LineChart1,
    LineChart3,
    LineChart4,
    BarChart1,
    MultiAxisLineChart
  } from "variables/charts.js";


const ProductionOutput = ({title, MultiAxisLineChart_Example1}) => {
    const [bigChartData, setbigChartData] = React.useState("HourlyData");
    const [bigChartData1, setbigChartData1] = React.useState("HourlyData");
    const [bigChartData11, setbigChartData11] = React.useState("HourlyData");

    const setBgChartData = (name) => {
      setbigChartData(name);
    };
    const setBgChartData1 = (name) => {
      setbigChartData1(name);
    };
    const setBgChartData11 = (name) => {
        setbigChartData11(name);
      };

    if (title == 1){
        return (
            <>



            <Col xs="12">
              <Card className="card-chart">
                <CardHeader>
                  <Row>
                    <Col className="text-left" sm="6">
                      <CardTitle tag="h3">Production Output</CardTitle>
                    </Col>
                    <Col sm="6">

                    </Col>
                  </Row>
                </CardHeader>
                <CardBody>
                  <div className="chart-area">
                    <Line
                      data={LineChart2[bigChartData]}
                      options={LineChart2.options}
                    />
                  </div>
                </CardBody>

              </Card>
            </Col>
            <Col xs="12">
              <Card className="card-chart">
                <CardHeader>
                  <Row>
                    <Col className="text-left" sm="6">
                      <CardTitle tag="h3">Cumulative Yield vs Target Yield</CardTitle>
                    </Col>
                    <Col sm="6">

                    </Col>
                  </Row>
                </CardHeader>
                <CardBody>
                  <div className="chart-area">
                    <Line
                      data={MultiAxisLineChart[MultiAxisLineChart_Example1]}
                      options={MultiAxisLineChart.options}
                    />
                  </div>
                </CardBody>

              </Card>
            </Col>
     </>
        )
    }


    else{
    return (
        null


    );}
};

export default ProductionOutput;
